import React, { useState } from "react";

const Feedback = ({ employee, onSubmit, onClose }) => {
  const [feedback, setFeedback] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    const feedbackData = {
      feedback,
      employeeId: employee.id,
    };
    onSubmit(feedbackData);
  };

  return (
    <div className="p-6 bg-whiter">
      <h2 className="text-xl mb-4">Feedback for {employee.name}</h2>
      <form onSubmit={handleSubmit}>
        <textarea
          value={feedback}
          onChange={(e) => setFeedback(e.target.value)}
          placeholder="Enter feedback"
          className="border border-gray-400 p-2 rounded w-full h-40"
        />
        <div className="mt-4 flex justify-between">
          <button
            type="button"
            onClick={onClose}
            className="bg-gray-500 text-whiter p-2 rounded hover:bg-gray-700"
          >
            Close
          </button>
          <button
            type="submit"
            className="bg-dark text-whiter p-2 rounded hover:bg-mid"
          >
            Submit Feedback
          </button>
        </div>
      </form>
    </div>
  );
};

export default Feedback;
